export async function callForOptions(accessToken) {
    const headers = new Headers();
    const bearer = `bearer ${accessToken}`;

    headers.append("Authorization", bearer);

    const options = {
        method: "GET",
        header: headers
    };
}

export async function callForUser(){
    const endpoint = "https://graph.microsoft.com/v1.0/users";
    return fetch(endpoint, callForOptions.options);
}
